(7, 'Energy supply is key to fuelling regional development', 'Kenya', '<p>In the more remote parts of East and Central Africa, economic growth can be challenging to stimulate. There have been few incentives for communities to receive outside investment or for neighbouring countries to strike up trade. In part, an answer to the problem lies in energy storage, supply and distribution, and the opportunities that fuelling solutions can bring to hard-to-reach areas.&nbsp;</p><p>Energy supply and development go hand in hand, so much so that to ensure access to affordable, reliable, sustainable, and modern energy for all is a UN Sustainable Development Goal.&nbsp;</p><p>It is easy to understand why. Energy is the foundation upon which a modern economy builds. It fuels the power plant that generates electricity for the manufacturer, who then relies on the fully fuelled truck to transport goods from Mombasa to Gulu or Dar es salaam to Goma.</p><p>There are countless positive knock-on effects for the businesses, communities and individuals involved in this complex supply chain. It is something that Dalbit, which will reach its twentieth year in business this year, has witnessed time and again: the power of energy to fuel regional development.&nbsp;</p><p>This is why it is frustrating to see a lack of nuance surrounding the international debate on energy. Some believe the balance has tipped too far in favour of decarbonisation at all costs. Instead, we should be taking a more measured approach, balancing energy access and sustainability. Dalbit, of course, believes fully in a zero-carbon future.</p><p>As an energy business, we understand better than anyone else how substandard energy infrastructure, from storage to distribution, prevents countries from reaching their full potential. Looking back at our successes – and failures – over the past twenty years, it is crystal clear how transformational access to energy, enabled by reliable infrastructure, can be.&nbsp;</p><p>Returning to the issue of transporting goods, we have been lucky enough to add over 1 million litres of Jet A-1 fuel storage capacity for two airports - Gulu and Arua - in Uganda since 2018. Planes can now touch down and refuel in these two airports, rather than covering the extra distance to Kampala en route to South Sudan, saving time and money. Fuelling solutions have provided a connectivity link with neighbouring countries, boosting investor confidence, and opening up business areas.&nbsp;</p><p>We are currently working to construct a storage facility in Dar es Salaam that will transform landlocked Zambia’s fuel supply. Crucially, increasing storage capacity will boost the supply of fuel, helping alleviate fuel shortages, which is vital for the sustainable development of Zambia. To ensure local capacity building, we conduct technology and knowledge transfer central to the project, which complements both Zambia and Tanzania’s efforts to grow their economies.&nbsp;</p><p>But it is not just about business; access to energy is also vital in delivering aid. We have proudly worked alongside the humanitarian organisations, fuelling planes that deliver emergency food assistance to Gulu and Goma in Uganda and the DRC, respectively. Thousands of malnourished children have since been given the nutrient-rich food they need so dearly.&nbsp;</p><p>This is one of the founding principles on which Dalbit was founded: to fuel regional growth and development. From humble beginnings, we are fortunate to supply energy to over ten countries across east and southern Africa, hoping to enter new markets soon. &nbsp;</p><p>And despite the hype surrounding renewable technologies and their potential in Africa, we firmly believe traditional fuel storage and distribution will remain a vital part of any country’s energy network. We look forward to contributing to the national development of even more countries over the next 20 years.&nbsp;</p><p>This does not mean that innovation and pushing boundaries are not central pillars to the green energy transformation of the continent. As LNG continues its emergence as a leading ‘bridge fuel’, we are investing in our business to adapt for this next step, ultimately helping countries move towards a low-carbon development path. Fundamentally, however, this will never come at the expense of delivery for our customers, allowing us to fulfil our mission to supply energy that fuels development consistently.&nbsp;</p><p>Article written by Timothy Skudi, CEO Dalbit Affiliates and published on <a href=\"https://petroleum.co.ke/images/PetroleumInsightMagazines/2022/PI_Q1_2022_FINAL.pdf\">PI Magazine</a>.&nbsp;</p>', '2022-05-24 02:41:48', '2022-05-25 16:59:55', NULL, 'energy-supply-is-key-to-fuelling-regional-development', 'Energy is the foundation upon which a modern economy builds. It is something that Dalbit, which celebrates its twentieth year in business this year, has witnessed time and again: the power of energy to fuel regional development.', 'Dalbit trucks delivering fuel to remote parts of East and Central Africa.', 'Dalbit, Energy, Petroleum Distribution, Energy Supply, Fuel Depots'),
(8, 'Our industry is at its best when we put local communities first', 'Kenya', '<p>As we continue to grapple with the effects of the Covid-19 pandemic, the last two years have been some of the most challenging our industry has experienced. Despite this, we are pleased to continue supplying and delivering vital petroleum products to local Governments and industries. The sector can take deserved pride in our collective efforts to keep the lights on – both physically and metaphorically – during such uncertain times.</p><p>At Dalbit, our work to meet countries’ energy needs and fuel development has not just happened over the past two years, but the past two decades. We’ve always been firm believers that, if done right, our sector can serve as an overwhelmingly positive force in Africa.&nbsp;</p><p>But as an industry, we still have a long way to go. Sub-Saharan Africa still has some of the lowest energy access rates globally. We believe that making our industry’s primary mission eradicating energy poverty is the right thing to do and good for business. This, I trust, is what has been our recipe for success for the past 20 years of Dalbit’s existence.&nbsp;</p><p><i><strong>Starting out</strong></i></p><p>Twenty years ago, we set out to make a positive change. As an African-led, African-run business, we were able to see the vast potential our region offered, which made us determined to unleash it to its fullest extent.</p><p>When we started, the petroleum industry faced significant and seemingly insurmountable hurdles. Countries in the region were dealing with a distinct lack of infrastructure, which was, in turn, holding back much-needed economic development.&nbsp;</p><p>Hence, in 2002, we began making meaningful, long-term investments into the region’s infrastructure to ensure consistent availability of products for local Governments, aid agencies and local industry. Twenty years on, we’ve expanded our business to support communities across ten different African countries, overseeing and supporting the installation of depots in Bor, Rumbek and Wau in South Sudan, Gulu and Arua in Uganda, and Goma and Lubumbashi in the Democratic Republic of Congo.&nbsp;</p><p><i><strong>Becoming a reliable supplier and distributor</strong></i></p><p>Our African roots have always been integral to this mission; they have lent us a unique advantage, equipping us with the knowledge and understanding to reach many under-served areas that multi-nationals cannot.&nbsp;</p><p>And as we all know, whilst our region boasts some of the most beautiful landscapes in our continent, this poses significant logistical challenges. East Africa’s geographic complexity has required us to dig deep, persevering over many years to identify new distribution routes for our trucks to navigate unchartered landscapes safely.&nbsp;</p><p>Similarly, our appetite for adventure has helped us mould a solutions-first approach to our business. In practice, this means focusing on offering client’s long-term energy plans that support their growth aspirations, as opposed to the traditional industry model of product-focused sales missions aimed at short-term returns.</p><p><i><strong>Purpose and profit</strong></i></p><p>We know well that being a truly successful business is about more than just serving customers; it is also about serving communities. After all, our mission is not just to fuel growth but also development, which is why we endeavour to give back to the communities we operate in, both economically <i>and&nbsp;</i>socially.&nbsp;</p><p>This was just as important to us in the early years as it is now. From supporting students in local schools to donating over $400,000 worth of PPE to local hospitals within the regions we operate in during the pandemic, our respect for and gratefulness to local communities underpin everything we do.&nbsp;</p><p>This desire to empower local people is also at the core of our everyday commercial operations.&nbsp;Rather than following the well-trodden path of extracting the region’s natural resources and moving swiftly on, we target economic growth to improve the lives of Africans. For us, this means supporting local people and unlocking new job opportunities – both directly and indirectly – for the region’s talented workforce, helping them achieve their full potential through training and upskilling. We’re firm believers that Africans are best placed to drive the change we want to see and encourage them to take the reins of their futures.&nbsp;</p><p>We don’t plan to stop here and constantly look to adapt to the future, studying the market to identify new opportunities to provide extra value for clients. LNG is one such market, and&nbsp;<a href=\"https://www.shell.com/energy-and-innovation/natural-gas/liquefied-natural-gas-lng/lng-outlook-2021.html#iframe=L3dlYmFwcHMvTE5HX091dGxvb2svMjAyMS8\">research</a> suggests demand will reach 700m tonnes by 2024, and the EU is already making early moves to facilitate investment into low-carbon gas projects. Looking ahead, we’ll be exploring this market as one of several new business streams. &nbsp;</p><p>We’re excited about what lies ahead and will continue to push the industry to become the best it can be through a socially conscious, development-first approach to business - both this year and in the 20 to come.&nbsp;</p><p>Article written by Timothy Skudi, CEO Dalbit Affiliates and published on <a href=\"https://petroleum.co.ke/images/PetroleumInsightMagazines/2022/PI_Q1_2022_FINAL.pdf\">PI Magazine</a>.</p>', '2022-05-24 04:34:50', '2022-05-24 04:34:50', NULL, 'our-industry-is-at-its-best-when-we-put-local-communities-first', 'Our African roots have always been integral to this mission; they have lent us a unique advantage, equipping us with the knowledge and understanding to reach many under-served areas that multi-nationals cannot.', NULL, 'Dalbit, Energy, Petroleum Distribution, Energy Supply, Fuel Depots'),
(9, 'Dalbit Marks Twenty Years of Fuelling Growth with Tree Planting', 'Kenya', '<p><strong>Nanyuki, Kenya, 20 May 2022&nbsp;| </strong>Dalbit Petroleum Ltd has marked its 20-year anniversary by planting 1,000 trees at the Mount Kenya Wildlife Conservancy as part of its environmental conservation efforts aimed at preserving the world’s first Mountain Bongo sanctuary.</p><p>The tree planting exercise is being done in partnership with the local communities and employees as part of a tree planting initiative that will contribute towards the Conservancy’s target of planting 5,000 indigenous tree species in 2022.<strong>&nbsp;</strong>This further complements the existing work done by the local communities and will ultimately contribute to the already existing 35,000 indigenous tree species previously planted in the Mount Kenya Forest.</p><p>In Kenya, Dalbit has played a leading role in supporting the government’s efforts to combat climate change through forest and landscape restoration. The government of Kenya currently has an objective to increase the country’s tree cover from 6.2% to 10% by 2030. Other than restoring the environment, the tree planting is aimed at providing a green and suitable environment for&nbsp;mountain&nbsp;bongos in the sanctuary, in support of the rewilding and breeding programme. The programme aims to improve the population of the endangered species in Kenya, from the current population of less than 100 in the wild.&nbsp;</p><p>Speaking at the event, Timothy Skudi, CEO at Dalbit said: “We are delighted to mark 20 years of fuelling regional growth across East, Central and Southern Africa. We have been instrumental in providing total energy solutions that have supported African businesses to drive economic growth and higher living standards. Whilst fuelling growth, we have also sought to create a lasting impact for the communities we serve. Giving back is an essential part of the way we operate each day, and through charitable giving and education, we have helped to address some of the greatest social challenges facing our region – including energy access, health, the environment and biodiversity. This tree planting is part of this impact, and we are thankful to the local community and stakeholders who have come to contribute to this sustainable action for our country.”</p><p>Dalbit has been a lead benefactor of the Mount Kenya Wildlife Conservancy initiative since 2013, which works to conserve critically endangered wildlife species in Nanyuki. The company’s funding and support for the scheme has recently culminated in the release of five mountain bongos, one of Kenya’s most iconic species, at the Mawingu Mountain Bongo Sanctuary in March 2022. These critically endangered animals are endemic to Kenya’s Mountain Forests.&nbsp;</p><p>Mr Skudi added that the tree planting initiative provides economic support to local communities, who sell seeds and saplings to the conservancy, and also provide paid labour for the exercise. In addition, involving local communities ensures sustainable action through local ownership.</p><p>The company has continued to supply fuel via road networks from depots for 20 years, ensuring energy access for customers in Kenya and across the Region. They have played a defining role in building up the energy infrastructure of frontier markets.</p><p>Looking to the future, Dalbit will continue to invest to fuel progress across the region, whilst giving back to the communities. Mr Skudi stated a belief that traditional fuel storage and distribution will remain a vital part of any country’s energy network and looks forward to contributing to the national development of even more countries over the next 20 years.&nbsp;</p><p>Innovation and pushing boundaries are central pillars of the green energy transformation of the continent. As Natural Gas continues its emergence as a leading ‘bridge fuel,’ Dalbit is investing its business to adapt for this next step, ultimately helping countries move towards a low-carbon development path.&nbsp;</p><p><strong>About Dalbit Kenya</strong></p><p>Dalbit Kenya is an oil marketing company dedicated to fuelling regional growth through reliable and safe distribution networks. The company has a long philanthropic history. We believe that our investment in people and communities serves as a catalyst in unlocking the great potential of Kenya. Our key community focus areas include education, health, community development and the conservation of wildlife and the environment. Dalbit Kenya is a member of the Janus Continental Group, a conglomerate comprising of market-leading companies in the petroleum, energy, hospitality, and real estate sectors.&nbsp;&nbsp;</p><p>Some of our activities in the recent past include:</p><p>Supporting public health efforts throughout the region. In 2020, Dalbit Kenya offered a Ksh 21.3m grant to Amref Health Africa to support the Government of Kenya’s efforts to step up testing activities. Dalbit also donated US$200,000 to CURE International and the Zambian Ministry of Health, and US$100,000 to the Beit-CURE Hospital in Lusaka, to support the procurement of PPE and other medical equipment.</p><p>As part of our efforts to fuel progress, Dalbit has also championed various education initiatives throughout the region. Since 2007, we have sponsored and helped finance the education of many children across Kenya through our support for the Palm House Foundation in Nairobi.&nbsp;</p><p>Furthermore, we’ve been proud to have the opportunity to work hand-in-hand with humanitarian organisations, fuelling planes that deliver emergency food assistance to Gulu and Goma in Uganda and the DRC, respectively. Thanks to this work, thousands of malnourished children have since been able to access the nutrient-rich food they need so desperately.&nbsp;</p><p>Through these activities, Dalbit has proven time after time that we will go the extra mile to help serve the needs of the communities in which we operate. Dalbit’s belief in the continent’s potential is what has motivated us to invest in infrastructure and energy solutions for underserved and hard-to-reach areas, helping to lift communities up from poverty, whilst fuelling prosperity.</p><p><strong>About MKWC</strong></p><p>Mount Kenya Wildlife Conservancy (MKWC) is a non-profit trust dedicated to preserving the environment and the wildlife within. The Conservancy is located in Nanyuki, at the foot of the scenic Mount Kenya, a UN World Heritage Site. It is home to 28 different animal species, a population of roughly 1,200 different animals. The Conservancy\'s three main programmes include a rehabilitation project for the Mountain Bongo antelope, an animal orphanage, and a conservation education programme.&nbsp;</p><figure class=\"image\"><img src=\"https://www.dalbitpetroleum.com/storage/64/IMG_0229.jpg\"><figcaption>The Mount Kenya Wildlife Conservancy fraternity named this Mountain Bongo after Dalbit as a thank you for our support.</figcaption></figure>', '2022-05-25 02:54:20', '2022-05-25 18:10:11', NULL, 'dalbit-marks-twenty-years-of-fuelling-growth-with-tree-planting', 'Dalbit has marked its 20-year anniversary by planting 1,000 trees at the Mount Kenya Wildlife Conservancy', 'Timothy Skudi, Dalbit Affiliates CEO during the tree planting drive.', 'Dalbit, Tree Planting, Conservation, Mount Kenya Wildlife Conservancy, Fuelling Regional Growth'),
(10, 'Dalbit Reaffirms Commitment to Kenyan Energy Sector as it Celebrates 20 Years of Fuelling Growth', 'Nairobi, Kenya', '<p><strong>Nairobi, Kenya, 24 October 2022</strong>: Dalbit Petroleum Limited celebrated 20 years of fuelling growth in Kenya and the region at a Gala Dinner held at the Radisson Blu Upper Hill, Nairobi, last Wednesday evening.&nbsp;</p><p>The company committed to continuing to deliver sustainable energy while supporting Kenya’s transition towards a low-carbon economy and was graced by His Excellency, Deputy President Rigathi Gachagua amongst other dignitaries.&nbsp;&nbsp;</p><p><strong>In his remarks, the Deputy President said:&nbsp;</strong><br>“I am very delighted to join the Dalbit family in celebrating 20 years of great and huge success.\"</p><p>“The new government led by Dr. William Ruto and I, is a government that believes that entrepreneurs and investors are the most important resource for our country\'s economic development. And therefore, our job is simple, to support and facilitate entrepreneurship and investment.”</p><p><strong>Trade, Investment and Industry CS nominee Moses Kuria reiterated the Government’s plan to boost investment and trade saying:&nbsp;</strong></p><p>“The Government of Kenya is committed to creating a conducive environment to do business, for people to export, and to expand our manufacturing base. The President recently launched our 20 by 30 manufacturing vision. This is to say that by the year 2030, we aim to raise the manufacturing GDP contribution from the current 7% to 20%.”</p><p>Since operations began in the country in 2002, Dalbit has fuelled the Kenyan economy through the reliable and safe distribution of petroleum products including gasoil, gasoline, Jet-A1 fuel, and heavy fuel oil. Dalbit helps supply much-needed energy access across Kenya, creating jobs, and spurring economic growth for all Kenyans as a direct result.</p><p><strong>Speaking at the event, Timothy Skudi, CEO Dalbit Affiliates reflected:&nbsp;</strong></p><p>“When we began in 2002, the petroleum industry faced significant and seemingly insurmountable hurdles. Countries in the region were dealing with drought, civil unrest and a distinct lack of infrastructure, which was, in turn, holding back much-needed economic development,”&nbsp;</p><p>“We are delighted that 20 years later, and counting, this homegrown business has been instrumental in addressing these challenges by providing total energy solutions that have supported Kenyan and regional businesses, driving economic growth and higher living standards for the people and communities we serve”.</p><p>Driven by the values of the pursuit of excellence, behaving with honour and integrity, having an entrepreneurial spirit, accelerating impact and embracing our responsibilities, Dalbit continues to supply fuel via road networks from five depots strategically located across the country; Mombasa, Nairobi, Nakuru, Kisumu, and Eldoret; this ensures fuel and energy access for customers in Kenya and across the region, as the company works on its vision to become the preferred petroleum company in East, Central and Southern Africa, through reliable distribution networks.</p><p>Dalbit does this even in the midst of a global energy crisis that has disrupted world economies which has slowed efforts to tackle the critical challenge of addressing climate change by reducing global greenhouse emissions.&nbsp;</p><p><strong>Humphrey Kariuki,&nbsp;Founder of Dalbit&nbsp;said:&nbsp;</strong></p><p>“Looking back at our successes – and failures – over the past twenty years, it is crystal clear how transformational access to energy, enabled by reliable infrastructure can be.</p><p>“Dalbit was founded on the principle of fuelling regional growth and development. From humble beginnings, we are fortunate to supply energy to over nine countries across East and Southern Africa, and look forward to contributing to the national development of even more countries over the next 20 years, and beyond”.</p><p>Looking into the future, Dalbit recognises the role of innovation in the green energy transformation of the continent and is investing in its business to adapt for this next step. We are committed to this challenge.&nbsp;</p><p>&nbsp;</p><p>*******************************************************</p><p><strong>About Dalbit Kenya</strong></p><p>Dalbit Kenya is an oil marketing company dedicated to fuelling regional growth through reliable and safe distribution networks. The company has a long philanthropic history. We believe that our investment in people and communities serves as a catalyst in unlocking the great potential of Kenya. Our key community focus areas include education, health, community development and the conservation of wildlife and the environment. Dalbit Kenya is a member of the Janus Continental Group, a conglomerate comprising of market-leading companies in the petroleum, energy, hospitality, and real estate sectors.&nbsp;&nbsp;</p><p>Some of our activities in the recent past include:</p><p><i>Tree planting</i></p><ul><li>Create a lasting impact for the communities in which it serves. The 148-strong team planted 1,000 trees at the Mount Kenya Wildlife Conservancy in May this year as part of its environmental conservation efforts aimed at preserving the world’s first Mountain Bongo sanctuary.</li><li>The tree planting exercise is being done in partnership with local communities as part of a tree planting initiative that will contribute towards the Conservancy’s target of planting 5,000 indigenous tree species in 2022.&nbsp;This further complements the existing work done by the local communities and will ultimately contribute to the already existing 35,000 indigenous tree species previously planted in the Mount Kenya Forest by Dalbit.</li></ul><p><i>Supporting public health</i></p><ul><li>In 2020, Dalbit Kenya offered a Ksh 21.3m grant to Amref Health Africa to support the Government of Kenya’s efforts to step up testing activities. Dalbit also donated US$200,000 to CURE International and the Zambian Ministry of Health, and US$100,000 to the Beit-CURE Hospital in Lusaka, to support the procurement of PPE and other medical equipment.</li><li>Furthermore, we’ve been proud to have the opportunity to work hand-in-hand with humanitarian organisations, fuelling planes that deliver emergency food assistance to Gulu and Goma in Uganda and the DRC, respectively. Thanks to this work, thousands of malnourished children have since been able to access the nutrient-rich food they need so desperately.</li></ul><p><i>Supporting education&nbsp;</i></p><ul><li>As part of our efforts to fuel progress, Dalbit has also championed various education initiatives throughout the region. Since 2007, we have sponsored and helped finance the education of many children across Kenya through our support for the Palm House Foundation in Nairobi.</li></ul><p>Through these activities, Dalbit has proven time after time that we will go the extra mile to help serve the needs of the communities in which we operate. Dalbit’s belief in the continent’s potential is what has motivated us to invest in infrastructure and energy solutions for underserved and hard-to-reach areas, helping to lift communities up from poverty, whilst fuelling prosperity.</p>', '2022-10-26 17:54:23', '2022-10-26 17:54:23', NULL, 'dalbit-reaffirms-commitment-to-kenyan-energy-sector-as-it-celebrates-20-years-of-fuelling-growth', NULL, 'A toast to Dalbit celebrating 20 years of fuelling regional growth.', 'Dalbit, Petroleum, Fuel, Regional Growth, Oil Marketer');
